INSERT INTO `blogs` (`id`, `title`, `image`, `description`, `date_added`, `user_id`, `status`, `avatar`) VALUES
(10, 'Auction Software', '0', 'Buy and sell tools which can be customized to Auction, Reverse Auction, Penny Auction and Silent Auction. We are suited for individual business entrepreneurs , family business , multi million corporates and government entities to deploy auction, buy it now , reverse , penny and silent online marketplaces. Our Software runs on Cloud & Dedicated Servers, also works well with 50+ payment gateways including Paypal, Authorize.net, Bluetree payment, Balanced payment & Adaptive payments.Buy and sell tools which can be customized to Auction, Reverse Auction, Penny Auction and Silent Auction. We are suited for individual business entrepreneurs , family business , multi million corporates and government entities to deploy auction, buy it now , reverse , penny and silent online marketplaces. Our Software runs on Cloud & Dedicated Servers, also works well with 50+ payment gateways including Paypal, Authorize.net, Bluetree payment, Balanced payment & Adaptive payments.Buy and sell tools which can be customized to Auction, Reverse Auction, Penny Auction and Silent Auction. We are suited for individual business entrepreneurs , family business , multi million corporates and government entities to deploy auction, buy it now , reverse , penny and silent online marketplaces. Our Software runs on Cloud & Dedicated Servers, also works well with 50+ payment gateways including Paypal, Authorize.net, Bluetree payment, Balanced payment & Adaptive payments.Buy and sell tools which can be customized to Auction, Reverse Auction, Penny Auction and Silent Auction. We are suited for individual business entrepreneurs , family business , multi million corporates and government entities to deploy auction, buy it now , reverse , penny and silent online marketplaces. Our Software runs on Cloud & Dedicated Servers, also works well with 50+ payment gateways including Paypal, Authorize.net, Bluetree payment, Balanced payment & Adaptive payments.\r\n        ', '2015-01-14 02:51:47', 1, 'open', '0'),
(11, 'Penny auction', 'onida-leo40fs-400x400-imae3872jgqzpym4.jpeg', '        A bidding fee auction, also called a penny auction, is a type of all-pay auction in which all participants must pay a non-refundable fee to place each small incremental bid. The auction ends after a period of time, typically ten to twenty seconds, without new bids; the last participant to have placed a bid wins the item and also pays the final bid price, which may be significantly lower than the retail price of the item. The auctioneer makes money in two ways: the fees for each bid and the payment for the winning bid, totalling typically significantly more than the value of the item.[1] Such auctions are typically held over the Internet, rather than in person', '2015-07-07 01:35:03', 1, 'open', '1cd01246c99abd3d1b911788e31078bd.jpeg'),
(12, 'penny auction blogger', '31K58lXNabL._SX425_.jpg', '        A blog (a truncation of the expression weblog)[1] is a discussion or informational site published on the World Wide Web and consisting of discrete entries ("posts") typically displayed in reverse chronological order (the most recent post appears first). Until 2009 blogs were usually the work of a single individual[citation needed], occasionally of a small group, and often covered a single subject. More recently "multi-author blogs" (MABs) have developed, with posts written by large numbers of authors and professionally edited. MABs from newspapers, other media outlets, universities, think tanks, advocacy groups and similar institutions account for an increasing quantity of blog traffic. The rise of Twitter and other "microblogging" systems helps integrate MABs and single-author blogs into societal newstreams. Blog can also be used as a verb, meaning to maintain or add content to a blog.\r\n        ', '2015-07-20 02:16:26', 1, 'unpublish', 'f874e390118f6f33cab0f0e0e30e7edb.jpg'),
(13, 'Blog - Wikipedia, the free encyclopedia', '41R5EYf-pOL._SX425_.jpg', '        A blog (a truncation of the expression weblog) is a discussion or informational site published on the World Wide Web and consisting of discrete entries A blog (a truncation of the expression weblog) is a discussion or informational site published on the World Wide Web and consisting of discrete entries.', '2015-07-22 04:04:04', 1, 'open', 'ea6572ef5654f92a57489df4e040cca2.jpg'),
(14, 'Google', '31hp6N9QLrL.jpg', '        Blogger is a blog-publishing service that allows multi-user blogs with time-stamped entries. It was developed by Pyra Labs, which was bought by Google in 2003 ', '2015-09-04 06:04:57', 1, 'open', '72e7ca997b337600beaabc0c25ac1ba7.jpg'),
(15, 'Tumblr', 'webs-com.png', '        Tumblr is easily the best of the 10 platforms when it comes to visuals. Images, videos, music—it’s all really easy to display on your tumblr profile. And, there are tons of creative ways that you can showcase them. People can also “reblog” your posts leaving you with more followers and a larger fanbase.\r\n\r\n\r\n        ', '2015-09-04 06:36:23', 1, 'open', 'c3a05cfff1e5824029bed2339ff00ce2.png'),
(16, 'yahoo', '61cuTqfGv2L._SL1024_1.jpg', '        This is a great platform to use if you’re looking to create more of a professional environment for your readers. You can drag and drop elements around your site for the ultimate customized page. The site also featured an ecommerce feature—great if you’re trying to sell a products.\r\n\r\n\r\n        ', '2015-09-04 06:54:07', 1, 'unpublish', '813acca3ef3eceace7abfce241a204af.jpg');
