(6, 10, 'I have over over 20 years of experience in design. I have worked as a Project Designer and a Job Captain for major architecture firms in Santa Clara, and Washington DC. Working with me will deliver you corporate quality service for an affordable price. I believe that built environment greatly affects human emotions, behavior, and overall well-being. It is our responsibility to work together with a clito work together with a client on creating environments that enhance human experience. I am happy to help individuals designing their homes, house additions, or office spaces. We are also happy to help architecture - See more at: http://dev.archability.com/arch/members.php?profile_update=update&id=68#sthash.oMcC17Lc.dpuf', 'Sound knowledge of building codes and construction standards. Range of expertise: Architectural Design, 3D Modeling, Photo-realistic Rendering, 3D Virtual, Reality , Working Drawings, Construction Drawings, Project Co-ordination, Interior Design. FF&E specification. I have in addition worked on a number of overseas projects, and several green projects where knowledge of sustainably design and conssustainably design and construction was required. I am LEED certified. - See more at: http://dev.archability.com/arch/members.php?profile_update=update&id=68#sthash.oMcC17Lc.dpuf', '---\n- ''1''\n- ''2''\n', '---\n- ''1''\n- ''2''\n- ''3''\n- ''4''\n', '2014-11-20 09:36:03', '2014-11-20 09:36:09'),
