INSERT INTO `email_template` (`id`, `event`, `subject`, `message`, `created_on`, `updated_on`, `status`, `user_id`) VALUES
(2, 'test event', 'test event', '<p>test event test eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest eventtest event</p>\r\n', '2015-07-09 04:43:46', '2015-07-09 04:43:46', 'active', 1),
(3, 'new_coupon_added', 'New coupon added', '<p>Hi {{event.userName}},<br />\r\n<br />\r\n{{event.message}}<br />\r\n<br />\r\nThanks,<br />\r\n<img alt="" src="{{event.siteurl}}/image/logo.png" /></p>\r\n', '2015-07-10 08:19:10', '2015-07-10 08:19:10', 'active', 1),
(4, 'newproductalert', 'A new product  {{event.title}}  has been posted', '<p>Hi {{event.userName}},</p>\r\n\r\n<p>A new product has been posted.</p>\r\n\r\n<p>Product name &nbsp;: &nbsp;{{event.title}}</p>\r\n\r\n<p>Product Url &nbsp; &nbsp; :&nbsp;&nbsp; {{event.url}}&nbsp;<br />\r\n<br />\r\nThanks,<br />\r\n<img alt="" src="{{event.siteurl}}/image/logo.png" /></p>\r\n', '2015-07-10 08:20:15', '2015-07-22 00:21:16', 'active', 1),
(5, 'seatedReminder', 'Seated Auction started for the auction  {{event.title}} ', '<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Hi {{event.user}}</p>\r\n\r\n			<p>&nbsp; Seated auction started for the product you reserved. You can now start bidding.<br />\r\n			<br />\r\n			Product name : {{event.title}}<br />\r\n			Auction Started : {{event.start}}<br />\r\n			Auction Ends : {{event.end}}<br />\r\n			Url : {{event.url}}</p>\r\n\r\n			<p>Thank you,<br />\r\n			<br />\r\n			<img alt="" src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:21:40', '2015-07-10 08:24:19', 'active', 1),
(6, 'item_added', 'New product ( {{event.product_name}}) listed on {{event.cat}}', '<p>Hi {{event.user}}</p>\r\n\r\n<p>{{event.product_name}} has been added on&nbsp; {{event.cat}}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>{{event.link}}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><img alt="" src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n', '2015-07-10 08:26:52', '2015-07-10 08:26:52', 'active', 1),
(7, 'seatedVacate', 'You have vacated seat from {{event.title}}', '<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Hi {{event.user}}</p>\r\n\r\n			<p>&nbsp; You&nbsp;have successfully vacated seat from the auction {{event.title}}. Seat amount ${{event.amount}} has been refunded to your account.</p>\r\n\r\n			<p>Thank you,<br />\r\n			<br />\r\n			<img alt="" src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:27:48', '2015-07-20 01:13:36', 'active', 1),
(8, 'seatedReserve', 'Congratulations!  Reserved Seat for {{event.title}}', '<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Hi {{event.user}}</p>\r\n\r\n			<p>&nbsp; You&nbsp;have successfully reserved seat for {{event.title}}. Seat amount ${{event.amount}} has been debited from your account. We will notify you when auction starts.</p>\r\n\r\n			<p>Thank you,<br />\r\n			<br />\r\n			<img alt="" src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:28:37', '2015-07-20 01:13:14', 'active', 1),
(9, 'winner_buyer', 'Congratulations, You’re the winning bidder!', '<p>{{event.sitename}}</p>\r\n\r\n<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Hi,&nbsp;{{event.fname}} {{event.tname}}</p>\r\n\r\n			<p>&gt;Congratulations, You&rsquo;re the winning bidder!</p>\r\n\r\n			<p>Item Title:&nbsp;{{event.title}}</p>\r\n\r\n			<p>Item Price:${{event.price}}</p>\r\n\r\n			<p>Item URL:&nbsp;{{event.url}}</p>\r\n\r\n			<p>For your convenience, here is the seller&#39;s payment policy:</p>\r\n\r\n			<p>We accept all major credit cards, Paypal, and bank wires.</p>\r\n\r\n			<p>Unless otherwise specified by the payment policy above, you must pay for the item within 72 hours to avoid a cancellation of your purchase.</p>\r\n\r\n			<p>Terms of Sale</p>\r\n\r\n			<p>All sales are FINAL. Product is sold AS IS, WHERE IS.</p>\r\n\r\n			<p>Buyer is responsible for all taxes, duties, loading and freight charges.</p>\r\n\r\n			<p>Seller offers no warranties direct or implied from manufacturer or otherwise.</p>\r\n\r\n			<p>Title transfers from Seller to Buyer upon release to Buyer logistics provider at pick up.</p>\r\n\r\n			<p>Buyer (or Buyer&rsquo;s logistics provider) must confirm quantity and condition at pick up. Upon release of product to the Buyer and removed from Seller&rsquo;s location, there will be no adjustments based on quantity or condition.</p>\r\n\r\n			<p>What&#39;s Next After Payment?</p>\r\n\r\n			<p>Seller will receive an email from ChemExchange upon receipt of Buyer payment. Seller will be instructed to email Buyer a pick-up/order number for issuance of product. If you haven&#39;t heard from the Seller within 72 hours, please contact us at support@chemexchange.com.</p>\r\n\r\n			<p>Contact Seller</p>\r\n\r\n			<p>Thank you,<br />\r\n			<br />\r\n			{{event.sitename}}<br />\r\n			<br />\r\n			<img src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:31:25', '2015-07-10 08:31:45', 'active', 1),
(10, 'project_posted', 'Your {{event.name}} Project Posted Succesfully!', '<p>{{event.sitename}}</p>\r\n\r\n<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Hi {{event.user}}</p>\r\n\r\n			<p>Your project was posted successfully</p>\r\n\r\n			<p>To view your {{event.name}} project.Please click the below link&nbsp;</p>\r\n\r\n			<p>{{event.url}}</p>\r\n\r\n			<p>Thank you,<br />\r\n			<br />\r\n			<img src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:32:39', '2015-07-10 08:32:39', 'active', 1),
(11, 'message', '{{event.subject}}', '<p>{{event.sitename}}</p>\r\n\r\n<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Hi {{event.fname}} {{event.tname}}</p>\r\n\r\n			<p>{{event.message}}</p>\r\n\r\n			<p>Thank you,<br />\r\n			<br />\r\n			<img src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:34:20', '2015-07-10 08:34:20', 'active', 1),
(12, 'forgot_password', 'Password Update Request', '<p>{{event.sitename}}</p>\r\n\r\n<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Hi {{event.firstName}} {{event.lastName}}</p>\r\n\r\n			<p>A request to update your password was submitted.</p>\r\n\r\n			<p>Please click on the below link to update your password.</p>\r\n\r\n			<p><a href="{{event.passwordurl}}">Click to Update Password.</a></p>\r\n\r\n			<p>If you did not request the password update, please ignore this email.</p>\r\n\r\n			<p>Thank you,<br />\r\n			<br />\r\n			<img src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:35:24', '2015-07-10 08:39:50', 'active', 1),
(13, 'item_sold', 'Your {{event.sitename}} Item Sold', '<p>{{event.sitename}}</p>\r\n\r\n<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Hi {{event.user}}</p>\r\n\r\n			<p>Your Item {{event.title}}&nbsp;has sold&nbsp;successfully!</p>\r\n			Item Title : {{event.title}}<br />\r\n			Item&nbsp;Price : ${{event.price}}<br />\r\n			Item&nbsp;&nbsp;Url&nbsp;: {{event.url}}<br />\r\n			Item&nbsp;&nbsp;qty : {{event.qty}}<br />\r\n			Buyer Name : {{event.bname}}<br />\r\n			Buyer Email : {{event.bemail}}<br />\r\n			Buyer Phone : {{event.bphone}}\r\n			<p>What&#39;s Next?</p>\r\n\r\n			<p>You will receive an email from {{event.sitename}} upon receipt of Buyer&rsquo;s payment. Please provide a pick-up/order number to the Buyer upon receipt of this email. If you haven&#39;t heard from the Buyer within 72 hours, please contact us at support@chemexchange.com.</p>\r\n\r\n			<p>Thank you,<br />\r\n			<br />\r\n			<img src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:36:55', '2015-07-10 08:39:42', 'active', 1),
(14, 'won_product', 'Congrats! Your Item Awarded to Highest Bidder', '<p>{{event.sitename}}</p>\r\n\r\n<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Hi Admin</p>\r\n\r\n			<p>Your Item was awarded to the highest bidder.</p>\r\n\r\n			<p>Product Title : {{event.title}}<br />\r\n			Product Price : ${{event.price}}<br />\r\n			Product Url&nbsp;: {{event.url}}<br />\r\n			Winner Name: {{event.user}}<br />\r\n			Winner&nbsp;Email: {{event.email}}<br />\r\n			\r\n			<p>Thank you,<br />\r\n			<br />\r\n			<img src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:37:53', '2015-07-20 09:44:28', 'active', 1),
(15, 'package_bought', 'Package Bought Successfully!', '<p>{{event.sitename}}</p>\r\n\r\n<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Hi {{event.user}}</p>\r\n\r\n			<p>You bought package succesfully</p>\r\n\r\n			<p>Package Price : ${{event.price}}</p>\r\n\r\n			<p>Thank you,<br />\r\n			<br />\r\n			<img src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:38:32', '2015-07-10 08:39:26', 'active', 1),
(16, 'watchlist_added', 'Item Successfully Added to your Watchlist', '<p>{{event.sitename}}</p>\r\n\r\n<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Hi {{event.user}}</p>\r\n\r\n			<p>&nbsp;{{event.title}} product added to your Watchlist.</p>\r\n\r\n			<p>Thank you,<br />\r\n			<br />\r\n			<img alt="" src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:39:17', '2015-07-10 08:39:17', 'active', 1),
(17, 'bid_submitted', 'Your Bid Submitted Successfully!', '<p>{{event.sitename}}</p>\r\n\r\n<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Hi {{event.user}}</p>\r\n\r\n			<p>&nbsp; Your ${{event.amount}} bid submitted successfully for {{event.title}}.We will notify you if you become a winner.</p>\r\n\r\n			<p>Thank you,<br />\r\n			<br />\r\n			<img alt="" src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:40:41', '2015-07-10 08:43:53', 'active', 1),
(18, 'Signed Up', 'Welcome to {{event.sitename}}!', '<p>{{event.sitename}}</p>\r\n\r\n<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Welcome to {{event.sitename}}, {{event.user}}</p>\r\n\r\n			<p>{{event.sitename}} is the industrial chemical marketplace to buy and sell surplus chemicals and equipment.<br />\r\n			You can start your own Auction by <a href="{{event.siteurl}}">posting an item(s)</a> or <a href="{{event.siteurl}}/search">bid on current auctions</a>. Please visit our FAQ page for help getting started.</p>\r\n			{% if event.activeurl != &#39;&#39; %} {{event.activeurl}} {% endif %}\r\n\r\n			<p>Thank you,<br />\r\n			<br />\r\n			<img src="{{event.siteurl}}/images/logoc.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:41:28', '2015-07-10 08:43:24', 'active', 1),
(19, 'verification', '{{event.user}}, Please Verify Your {{event.sitename}} Account', '<p>{{event.sitename}}</p>\r\n\r\n<table cellpadding="0" cellspacing="0" style="width:600px">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<p>Hi {{event.user}},</p>\r\n\r\n			<p>Thank you for registering with {{event.sitename}} ! .</p>\r\n			Click &nbsp;the blue link below to get started!\r\n\r\n			<p>&nbsp; {{event.activeurl}}</p>\r\n\r\n			<p>Thank you,<br />\r\n			<br />\r\n			<img alt="" src="{{event.siteurl}}/image/logo.png" style="width:160px" /></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n', '2015-07-10 08:42:48', '2015-07-17 08:29:12', 'active', 1);
