(460, 'Mac Book Pro', 'When you pack so many pixels into a display — over four million on the 13-inch model and over five million on the 15-inch model — the results are positively stunning. The pixel density is so high, your eyes can’t discern individual pixels. Images take on a new level of realism. A spectacular 2560x1600 resolution on the 13-inch MacBook Pro and an equally impressive 2880x1800 resolution on the 15-inch MacBook Pro let you see more of your high-resolution images with pixel-for-pixel accuracy. And text is so sharp, you’ll feel like you’re reading email, web pages and documents on a printed page.\r\n\r\nThe Retina display reduces glare while maintaining incredible colour and quality. Its high contrast ratio results in blacker blacks and whiter whites. And everything in between is rich and vibrant. IPS technology gives you a wide, 178-degree view of everything on the screen, so you’ll see the difference at practically any angle. And you’re going to love what you see.', NULL, NULL, NULL, '2015-07-09 12:25:41', '2015-07-17 03:27:40', '1', NULL, 'mac book pro', '0.01', 'NaN', NULL, NULL, NULL, 1, NULL, 0, '2015-07-06 03:29:40', NULL, NULL, 0, 0, 10.00, 'UPS', 1000.00, 1200.00, 0.01, 0.01, 'removed', 'penny', 0, 0, 0),
