(520, 'The small BIG: Small Changes that Spark Big Influence ', 'At some point today you will have to influence or persuade someone - perhaps ask a colleague a favour, negotiate with a contractor or get your spouse to put out the recycling. In The Small Big, three heavyweights from the world of persuasion science and practice - Steve Martin, Noah Goldstein and Robert Cialdini - describe how, in today''s information-overloaded world, it is now the smallest changes that lead to the biggest differences in results. Offering deceptively simple suggestions and explaining the extensive scientific research behind them', '052dbad14bda4394ef90fb756835b325.jpg', 'engine.jpg', NULL, '2015-08-12 00:19:05', '2015-08-29 00:35:48', '23', NULL, 'book', '0.01', '46.00', NULL, NULL, NULL, 1, NULL, 1, '2015-08-12 00:20:21', NULL, NULL, 1, 0, 1.20, 'will be shipped in 2 days', 37.00, 60.00, 0.01, 0.06, 'sold', 'penny', 0, 0, 0),
