(538, 'It Doesn''t Hurt To Be Nice: Rediscover spirituality, served with a pinch of salt and humour', '<p>Kiara is a dynamic, thirty-something girl who has reached great heights professionally, and is the apple of the eye for almost everyone who knows her. But she never took any short cuts to become happier, wiser, healthier and more compassionate. She had to find rays of hope where the dark tunnel seemed unending, and identify shade in life&#39;s burning path. She found little pearls of wisdom in chasing her dreams, in spreading laughter, in learning from scriptures and philosophers, and even at one point in&nbsp;</p>\r\n\r\n<h2>Product Description</h2>\r\n\r\n<h3>Review</h3>\r\n\r\n<p>&quot;<em>Amisha&#39;s</em>&nbsp;novel is a wonderful way to reconnect with your roots by reinterpreting the scriptures with a contemporary twist. A must read for all.&quot; &ndash;&nbsp;<strong>Bindu Gopal Rao, Contributor Femina</strong></p>\r\n\r\n<h3>About the Author</h3>\r\n\r\n<p>Amisha Sethi is an executive scholar from Kellogg School of Management, Northwestern University, Chicago, and holds an MBA degree in Marketing from Amity Business School. She was awarded the &quot;Young women rising star&quot; at World Women Leadership Congress 2014 and has won numerous awards and recognition in her corporate life. Along with holding top notch positions in leading companies in the past thirteen years, she has also done extensive research in ancient scriptures. In this book, she uses certain hilarious, dramatic and enthralling experiences of a young girl to understand the ultimate purpose of life &mdash; to be a better human with each passing day.&nbsp;</p>\r\n\r\n<h2>Product Description</h2>\r\n\r\n<h3>Review</h3>\r\n\r\n<p>&quot;<em>Amisha&#39;s</em>&nbsp;novel is a wonderful way to reconnect with your roots by reinterpreting the scriptures with a contemporary twist. A must read for all.&quot; &ndash;&nbsp;<strong>Bindu Gopal Rao, Contributor Femina</strong></p>\r\n\r\n<h3>About the A